import React from "react";
import style from'./lista.module.scss';

function Lista(){
    const tarefas = [{
        tarefa: 'react',
        tempo:'01:10:00'
        },{
         tarefa:'Javascript',
         tempo:'01:30:00'
        },{
         tarefa:'Typescript',
         tempo: '02:20:00'

        }];
    return(
        <aside className={style.listaTarefas}>
            <h2>Estudos do Dia</h2>
            <ul>
                {tarefas.map((item, index)=>(
                    <li key={index} className={style.item}>
                        <h3>
                            {item.tarefa}
                        </h3>
                        <span>
                            {item.tempo}
                        </span>
                    </li>
                ))}

            </ul>
        </aside>
    )
}

export default Lista;
